eval("module.exports = \"extends templates/product\\r\\n\\r\\nblock product-title\\r\\n  title L-80 Liquid Chiller \\r\\n  link(rel=\\\"canonical\\\" href=\\\"https://cryometrix.com/product-L80\\\")\\r\\n\\r\\nblock description\\r\\n  h1 Cryometrix L-80 Liquid Chiller\\r\\n  div \\r\\n    a(href=\\\"brochures/Cryometrix_L-80.pdf\\\" download=\\\"Cryometrix_L-80\\\") #[i.far.fa-file-alt] #[span Download Brochure]\\r\\n    //-a#calculator(href=\\\"#\\\") #[i.fas.fa-calculator] #[span Calculate Storage Space]\\r\\n    //- a Download Map\\r\\n  p Cryometrix is proud to announce the arrival of a revolutionary new product - the Cryometrix L-80 Liquid Chiller.\\r\\n  br\\r\\n  p Utilizing liquid nitrogen, the L-80 is the fastest liquid chiller on the market. Capable of chilling 120 gallons of Ethanol to -65&degC in under 90 minutes, the L-80 is the most powerful yet price-efficient tool for chilling solvents. Featuring patent-pending technology, the L-80 is specifically designed to work with liquids like ethyl alcohol for CDB extraction.\\r\\n  br\\r\\n  p The L-80 is portable, requires zero changes to your build's infrastructure and has a low power requirement of 110 volts, enabling it to be implemented in any facility. With practically silent operation, the L-80 Liquid Chiller is ideal for chilling solvents or other liquids used in a lab, small manufacturing processes, or large-scale production facilities.\\r\\n  br\\r\\n  p Contact us at (801) 226-4100 for more information.\\r\\n\\r\\nblock table\\r\\n  .english\\r\\n    table\\r\\n      tr\\r\\n        th Physical Property\\r\\n        th Metric\\r\\n        th Imperial\\r\\n      tr\\r\\n        td External Dimensions <br/>(Depth x Width x Height)\\r\\n        td 1016 mm x 1219 mm x 1676 mm \\r\\n        td 40\\\"  x 48\\\"  x 66\\\" \\r\\n      tr\\r\\n        td Barrel Dimensions <br/>(Diameter x Height)\\r\\n        td 762 mm x 1168 mm \\r\\n        td 30\\\" x 46\\\"\\r\\n      tr\\r\\n        td Barrel Capacity\\r\\n        td 454 liters \\r\\n        td 120 gallons\\r\\n      tr\\r\\n        td Temperature Range\\r\\n        td 20&degC to -80&degC \\r\\n        td 68&degF to -112&degF\\r\\n      tr\\r\\n        td Peak Variation from Setpoint\\r\\n        td 1&degC &plusmn; \\r\\n        td 1.8 &degF &plusmn;\\r\\n      tr\\r\\n        td 120 gal Ethanol Pull Down <br/> -65&degC (-85&degF)\\r\\n        td(colspan=\\\"2\\\") < 90 minutes\\r\\n      tr\\r\\n        td 120 gal Ethanol Pull Down <br/> -40&degC (-40&degF)\\r\\n        td(colspan=\\\"2\\\") < 70 minutes\\r\\n      tr\\r\\n        td Fill Time\\r\\n        td(colspan=\\\"2\\\") 6 minutes\\r\\n      tr\\r\\n        td Drain Time (@ -65&degC)\\r\\n        td(colspan=\\\"2\\\") 12 minutes\\r\\n      tr\\r\\n        td LN2 Consumption / Cycle\\r\\n        td 283 L\\r\\n        td 75 gal\\r\\n      tr\\r\\n        td LN2 Usage / Gal Ethanol Chilled\\r\\n        td 2.2 L / 1 gal \\r\\n        td 0.6 gal / 1 gal\\r\\n\\r\\n\\r\\n\\r\\n    \\r\\n\\r\\nblock image-slider\\r\\n  img(src=\\\"images/freezers/L-80/L80.png\\\")\\r\\n  img(src=\\\"images/freezers/L-80/L80_with_person.png\\\")\\r\\n\\r\\nblock features-benefits\\r\\n  div\\r\\n    .left\\r\\n      div\\r\\n        h2 Applications\\r\\n        ul \\r\\n          li CBD/THC Extraction\\r\\n          ul \\r\\n            li A common type of CBD extraction uses ethanol to extract the useful cannabinoids. The warmer the ethanol, the more unwanted plant particulates are also extracted. Because of this, chilling the ethanol increases extracted Cannabinoid purity. \\r\\n          li Research\\r\\n          ul \\r\\n            li Liquid chillers are typically large, bulky, and expensive, requiring large budgets for any research that required them. The L-80 allows for smaller, sleeker, and cheaper chilling of liquids used for research.\\r\\n          li Manufacturing\\r\\n          ul \\r\\n            li The L-80 is suited for small operations or large scale industrial production.\\r\\n      div\\r\\n        h2 Key Features \\r\\n        ul \\r\\n          li Automatic Fill Stop\\r\\n          ul \\r\\n            li The L-80 will automatically stop pumping from the bulk liquid supply once the top fill level is reached.\\r\\n          li Automatic Drain Stop \\r\\n          ul \\r\\n            li The L-80 will automatically stop pumping liquid out of the chilling chamber once the low level is reached.\\r\\n          li Datalogging\\r\\n          ul \\r\\n            li The L-80 constantly logs liquid temperature, LN2 pressure, and pump load.\\r\\n          li Food Grade Stainless Steel\\r\\n          ul \\r\\n            li The liquid being chilled within the L-80 only comes into contact with food-grade stainless steel.\\r\\n          li Zero Workspace Modification\\r\\n          ul \\r\\n            li The L-80 is small and portable, fitting into any workspace and can be moved with a pallet jack.\\r\\n            li Running on 110v, the L-80 can plug into common outlets.\\r\\n            li Zero heat is rejected into the room, so no HVAC is required.\\r\\n      div\\r\\n        h2 Benefits over Compressor-Based Liquid Chillers\\r\\n        ul \\r\\n          li Less Maintenance\\r\\n          ul \\r\\n            li Unlike compressor-based chillers which have hundreds of moving parts, the L-80 has only a few moving parts, so very little maintenance is required.\\r\\n          li Reduced Electric Power Usage\\r\\n          ul \\r\\n            li You will not need to run any power to your building when running our chiller.\\r\\n          li Faster Chilling and Better Performance\\r\\n          ul \\r\\n            li The low temperature of LN2 enables the L-80 to chill rapidly and to lower temperatures.\\r\\n      div\\r\\n        h2 Complete Safety\\r\\n        ul\\r\\n          li Closed Nitrogen System\\r\\n          ul \\r\\n            li There is zero contact between LN2 and the operator or product.\\r\\n            li LN2 storage is simple and completely autonomous.\\r\\n          li Unreactive\\r\\n          ul \\r\\n            li Nitrogen isn't flammable or explosive like many refrigerants used in compressor-based technologies.\\r\\n          li Easy Cleaning\\r\\n          ul \\r\\n            li The 100% stainless steel design is easy to clean without harsh industrial chemicals.\\r\\n      div\\r\\n        h2 Environment Friendly\\r\\n        ul\\r\\n          li Clean Emissions\\r\\n          ul \\r\\n            li Cryometrix products only emit nitrogen outside your building, which already makes up over 75% of the Earth's atmosphere.\\r\\n          \\r\\n      \\r\\n      \\r\\n    .right\\r\\n      div\\r\\n        h2 Powerful Innovation\\r\\n        ul \\r\\n          li Next-Gen Liquid Nitrogen Tech\\r\\n          ul \\r\\n            li Cryometrix products don't use traditional mechanical compressors that utilize refrigerants, an example being freon, to produce cold temperatures. These are noisy and use large amounts of electricity.\\r\\n            li LN2 has a boiling point of -196&degC, enabling temperatures as low as -196&degC. Most refrigerants have boiling points greater than -100&degC, making it difficult for technology that uses them to generate temperatures below that.\\r\\n          li Low Energy Usage\\r\\n          ul \\r\\n            li Cryometrix tech use 7x less electricity than comparable products.\\r\\n            li LN2 operates on pressure and requires no electricity to function, enabling it to function without power in emergency situations.\\r\\n          li Extreme Reliability\\r\\n          ul \\r\\n            li Cryometrix freezing technology doesn't require HVAC systems to cool the ambient temperature in order to operate. It can operate in any ambiance and cools the environment around it.\\r\\n            li There are practically no moving parts in Cryometrix LN2 freezing technology, making it last up to 4 times as long as comparable freezing technology, in addition to requiring hardly any maintenance.\\r\\n            li Practically silent when in operation.\\r\\n          li Easily Expandable\\r\\n          ul \\r\\n            li Cryometrix products consume little electricity, enabling the customer to add additional units to their facility with zero electrical complications.\\r\\n            li The effective footprint is 16 square feet and little to no space is needed on the sides, easily fitting into any facility.\\r\\n          li Extreme Versatility\\r\\n          ul \\r\\n            li The L-80 can chill any liquid that can handle the ultra-low temperatures at which it operates.\\r\\n      div\\r\\n        h2 Cost Efficiency\\r\\n        ul\\r\\n          li Space Efficient\\r\\n          ul \\r\\n            li The Cryometrix L-80 Solvent Chiller has the smallest footprint for its liquid chilling capability, costing less in floor space and allowing you to fit more units in your current space.\\r\\n          li Simple Design\\r\\n          ul \\r\\n            li The simple functioning and operation of the L-80 doesn't require extensive training, reducing labor costs and risks.\\r\\n          li Low Energy Costs\\r\\n          ul \\r\\n            li LN2 technology uses much less electricity than traditional compressor-based technologies.\\r\\n            li Cryometrix products don't need energy intensive HVAC systems to operate efficiently.\\r\\n          li Greater Throughput\\r\\n          ul \\r\\n            li The increased capability of the L-80 allows faster turnaround times and thus greater profits.\\r\\n      div\\r\\n        h2 Sample Integrity\\r\\n        ul\\r\\n          li Closed System\\r\\n          ul \\r\\n            li No LN2 is exposed to the sample, maintaining the samples integrity.\\r\\n          li Data-Logging\\r\\n          ul \\r\\n            li The L-80 automatically tracks temperature and other useful data.\\r\\n          li Temperature Uniformity\\r\\n          ul \\r\\n            li A cryogenic pump maintains high flux throughout chilled liquid, maintaining even temperatures throughout.\\r\\n\\r\\n\\r\\n\"\n\n//# sourceURL=webpack:///./app/src/pug/product-L80.pug?");

